import React from 'react';
import { Link, withRouter } from 'react-router-dom';

const Navigation = (props) => {
	const { history } = props; 

	return(
		<nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/resident">Soy un residente</Link>
            </li>
            <li>
              <Link to="/guest">Quiero pedir una invitación</Link>
            </li>
            <li>
              <Link to="/depositWithdraw">Ingresar/Retirar</Link>
            </li>
          </ul>
			<button className="button" onClick={() => history.push("/")}>Home</button>
			<button className="button" onClick={() => history.push("/resident")}>Soy un residente</button>
			<button className="button" onClick={() => history.push("/guest")}>Quiero pedir una invitación</button>
			<button className="button" onClick={() => history.push("/depositWithdraw")}>Ingresar/Retirar</button>
		</nav>
	);
}

export default withRouter(Navigation);
